import styles from "./SecondarySpace.module.css"




export default function MainSpace() {
  return (
    <>
      <section className={styles.main_space}>
        <div className={styles.head_content}>
            <h1 className={styles.title}>Готовь</h1>
        </div>

      </section>
    </>
  )
}
